import { Tabs, Tab, Toolbar, Typography, Box,Button } from '@mui/material';
import AppBar from '@mui/material/AppBar';

export const Navbar = () => {



    return (
        <>
             
                    <Box
                        sx={{ display: 'flex', p: 1, bgcolor: 'background.paper', borderRadius: 1 }}
                    >
                         <Tab lable='Home'/>
                         <Button 
                         variant='contained'
                         color='secondary'>sfa</Button>

                    </Box>
                
        </>
    )
}
